prisma_schema:
model Group2 {
  id        Int       @id @default(autoincrement())
  createdAt DateTime?
  updatedAt DateTime
  name111   String
  test      Int
}

model List {
  id         Int    @id @default(autoincrement())
  integer    Int
  float      Float
  string     String
  booleansss BigInt
  test       String
}

model Post {
  id        Int      @id @default(autoincrement())
  published Boolean  @default(false)
  title     String
  authorId  Int
  createdAt DateTime @default(now())
  updatedAt DateTime
  User      User     @relation(fields: [authorId], references: [id])

  @@index([authorId], map: "Post_authorId_fkey")
}

model Untitled1001 {
  id        Int       @id @default(autoincrement())
  createdAt DateTime  @default(now())
  updatedAt DateTime
  deletedAt DateTime?
}

