}

model Untitled3 {
  id        Int       @id @default(autoincrement())
  createdAt DateTime  @default(now())
  updatedAt DateTime
  deletedAt DateTime?
}

model User {
  id        Int       @id @default(autoincrement())
  createdAt DateTime? @default(now())
  email     String?   @unique
  name      String?
  password  String?
  groupId   Int?
  sex       String?
  Post      Post[]

  @@index([groupId], map: "User_groupId_fkey")
}

